  declarations: [
    AppComponent,
    FirstComponentComponent,
    ParentDataComponent,
    DirectivesComponent,
    IfRenderComponent,
    EventosComponent,
    EmitterComponent,

  ],
  imports: [
    BrowserModule,
    AppRoutingModule
  ],
